  input: TEXT,F3A,,"RE:Letter of 9/24/02 - All column B discrepancies have been corrected.  Errors
    were caused when 12 day Pre-Primary report was amended on 9/8/02.  Schedule A
    contribution through a conduit - all contributions over $200 had been reported.
    However,date received by conduit was not used.  This has been corrected and a
    note added to each contribution to indicate it was through a conduit.  Please
    note -    Item C on page 29 - this receipt date shows 4/18/02.  It was actually
    received by the conduit on 4/16 but we did not receive it until 4/24/02.  Since
    4/16 was in prior period, this report would not accept date.  I did not know what
